import React from 'react';
import {SliderData }from "../helpers/SliderData";
import ImageSlider from '../helpers/ImageSlider';

const DestinationDetail = (props) => {
  const destinationId = props.match.params.destinationId;
  const destination = destinationData.find(destination => destination.id === destinationId);

  return (
    <div>
      <h1>{destination.name}</h1>
      <p>{destination.description}</p>
      <ImageSlider SliderData={destination.SliderData} />
    </div>
  );
};

export default DestinationDetail;
